const presetMachines = {
    'busy_beaver_champion_5_2.txt': '',
    'Collatz_machine_3_4.txt':
        '',
    'powers_of_two_5_4.txt': '',
    'powers_of_two_15_2.txt': '',

    'weak_Collatz_conjecture_43_4.txt':
        '',

    'weak_Collatz_conjecture_124_2.txt':
        ''
}

const defaultMachine = 'powers_of_two_5_4.txt';
var sel = document.getElementById('select-preset');

for (machineName in presetMachines) {
    var opt = document.createElement('option');
    opt.appendChild(document.createTextNode(machineName));
    if (machineName === defaultMachine) {
        opt.selected = true;
    }
    sel.appendChild(opt);
}
